MarkdownBlockBase.code_block:
-- Creating master key CREATE MASTER KEY;
-- Creating a database scoped credential CREATE DATABASE SCOPED CREDENTIAL <Credential Name> WITH IDENTITY = '<User Name>' , Secret = '<Azure Storage Key>' ;
-- Creating external file format (delimited text file) CREATE EXTERNAL FILE FORMAT text_file_format WITH ( FORMAT_TYPE = DELIMITEDTEXT , FORMAT_OPTIONS ( FIELD_TERMINATOR ='|' , USE_TYPE_DEFAULT = TRUE ) );
--Creating an external data source CREATE EXTERNAL DATA SOURCE azure_storage WITH ( TYPE = HADOOP , LOCATION ='wasbs://<Container>@<Blob Path>' , CREDENTIAL = <Credential Name> ) ;

-- Creating external table pointing to file stored in Azure Storage
CREATE EXTERNAL TABLE <External Table Name> 
(
    <Column name>, <Column type>, <NULL/NOT NULL>
)
WITH 
(   LOCATION='<Folder Path>'
,   DATA_SOURCE = <Data Source>
,   FILE_FORMAT = <File Format>      
);
